import React, { Component } from 'react';
import Portrait from '../Logo/Portrait';
import Signature from '../Logo/Signature';

export default class Right extends Component {
  render() {
    return (
      <div style = { desktopRight }>
      Logo
        <Portrait />
        <Signature />
      </div>
    )
  }
}

const desktopRight = {
  width: '40%',
  border: '2px solid green'
}
